        padding: 0;
        margin: 0;
        border: none
    }




    .main {
        padding: 1em;
        position: relative;
        overflow: hidden;
        margin: auto;
        background: #fff;
    }

    body {
        background: #fff;
        margin: 0;
        padding: 0;
    }

    .chart-items {
        margin: auto;
        width: 80%;
        max-width: 150mm;
    }

    .news-item-info-date {
        color: #A0A4A8;
        margin: 5mm 0 0 0;
        display: inline-block;
        float: left;
        direction: ltr;
        font-size: 13px;
        padding: 0;
        line-height: 0;
    }

    table {
        width: 100%;
    }


    body {
        background: #ccc;
    }


    .header, .footer {
        display: none;
    }

    .top-link {
        content: ""
    }

    .list-toc {
        position: fixed;
        right: 0;
        background: #fff;
        width: 300px;
        top: 0;
        bottom: 0;
        overflow: auto;
        z-index: 11;
        box-shadow: 0 0 5px rgba(0, 0, 0, 0.3);
    }

    .list-toc h1 {
        margin: 0;
        line-height: 13mm;
        overflow: hidden;
        padding: 0 10px;
        background: #eee;
        border-bottom: 1px solid #eee;
    }

    .list-toc li {
        border-top: 1px solid #eee;
    }

    .toc-op,
    .toc-op span {
        display: inline-flex;
        justify-content: center;
        align-items: center;
    }

    .toc-op span {
        width: 20px;
        height: 20px;
        cursor: pointer;
        background: #eee;
        font-size: 10px;
        margin: 1px;
        border-radius: 0.5em;
        display: flex;
        align-items: center;
        justify-content: center;
        font-weight: 700;
        line-height: 0;

    }

    .toc-op span.delete {
        background: #600;
        color: #fff;
    }

    .toc-op span:hover {
        background: #333;
        color: #fff;
    }

    .deleted {
        filter: opacity(0.4) grayscale(0.7);

    }

    .deleted-content {
        filter: opacity(0.4) grayscale(0.7);
    }
</style>

